She's Back!

Ever wonder where your favorite star goes when she retires? It's a common question: whatever happened to her? As you probably know, from 1998 to 2005 Gauge was one of the best. One of the tops in the game. And then she disappeared. She educated herself. She did family things. And then she decided it was time to come back. We're really proud to have one of her first scenes since she hit the comeback trail, and as you're about to see, the girl still has It.

I don't normally upload anything above 720P but this is a special occasion.
